import {useEffect, useState} from "react";
import axios from "axios";


function App(){
    const[Name, setName] = useState("fo");
    useEffect( () =>{
        const fetchName = async () => {
            try {
              const res = await axios.get("http://localhost:5000/students");
              console.log(res.data);
              setName(res.data[2].name);
            } catch (error) {
              console.log(error);
            }
          };
          fetchName();
    }, []);
    return <div>
        <input name = "iName" placeholder="Enter your name"></input>
        <input name = "iEmail" placeholder="Enter your email"></input>
        <button>Submit</button>
        <h1>{Name}</h1>
    </div> 
}

export default App;
